import React from 'react';

function Story() {
  return (
    <div className='w-full h-screen bg-white overflow-hidden'>
    <div className='w-full h-screen py-[10%] text-white'>
    <div className='max-w-screen-2xl h-screen mx-auto px-5 sm:px-10 py-40 bg-zinc-900'> 
        <div className='px-16 '>
        <h1 className='text-[8rem] tracking-tighter'>Our</h1>
        <h1 className='text-[8rem] tracking-tighter'>Story</h1>
        </div>
      </div>
    </div>
    </div>
  )
}

export default Story
